import React, { Component } from "react";
import Header from "./components/ui/Header/Header";
import Main from "./components/Main";
import Display from "./components/Display";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Main />
        <Display />
      </div>
    );
  }
}

export default App;
